import React from "react";

export default function Navbar() {
  return (
    <>
      <nav className="navbar bg-light">
        <div className="container-fluid">
          <a className="navbar-brand text-center" href="a">
            Navbar
          </a>
        </div>
      </nav>
    </>
  );
}
